CREATE ALGORITHM=UNDEFINED DEFINER=`avare`@`10.%` SQL SECURITY DEFINER VIEW `db_aboundinginlove`.`sponsee_listing` AS select `s`.`id` AS `id`,`s`.`firstname` AS `firstname`,`s`.`lastname` AS `lastname`,`s`.`middlename` AS `middlename`,`s`.`gender` AS `gender`,`s`.`address` AS `address`,`s`.`country` AS `country`,`s`.`maplocation` AS `maplocation`,`s`.`videolink` AS `videolink`,`s`.`long_description` AS `long_description`,`s`.`short_description` AS `short_description`,`s`.`birthdate` AS `birthdate`,(year(now()) - year(`s`.`birthdate`)) AS `age`,sum(coalesce(`sn`.`neededamount`,0)) AS `total_neededamount`,sum(coalesce((case when (`sn`.`status` = 'CLOSED') then `sn`.`neededamount` else `sn`.`donatedamount` end),0)) AS `total_donatedamount`,coalesce(((sum(coalesce((case when (`sn`.`status` = 'CLOSED') then `sn`.`neededamount` else `sn`.`donatedamount` end),0)) / sum(coalesce(`sn`.`neededamount`,0))) * 100),0) AS `percentage` from (`db_aboundinginlove`.`sponsees` `s` left join `db_aboundinginlove`.`sponsee_needs` `sn` on((`sn`.`sponsee_id` = `s`.`id`))) group by `s`.`id`;

